import React from 'react';
import { FormGroup, FormControl, InputLabel, Input, Button, makeStyles, Typography } from '@material-ui/core';
import Container from '@material-ui/core/Container';
import NavLink from 'react-router-dom/NavLink';







const useStyles = makeStyles({
    container: {
        backgroundColor: '#2E8BC0',
        padding: '20px',
        shadowColor: "#000",
        shadowOffset: {
            width: 0,
            height: 10,
        },
        shadowOpacity: 0.12,
        shadowRadius: 60,
        width: '50%',
        border: 'black 2px',
        margin: '5% 0 0 25%',
        '& > *': {
            marginTop: 20
        }
    },
    ptag:{
        alignContent: 'center',
    }
})

const Signup = () => {

    const classes = useStyles();

    const onValueChange = (e) => {
        console.log();
    }


    return (
        <>


            <Container maxWidth="md" >
                <FormGroup className={classes.container}>
                    <Typography variant="h4">SignUp</Typography>

                    <FormControl>
                        <InputLabel htmlFor="my-input">Full Name</InputLabel>
                        <Input onChange={(e) => onValueChange(e)} name='fullname' id="my-input" />
                    </FormControl>
                    <FormControl>
                        <InputLabel htmlFor="my-input">Address</InputLabel>
                        <Input onChange={(e) => onValueChange(e)} name='address' id="my-input" />
                    </FormControl>
                    <FormControl>
                        <InputLabel htmlFor="my-input">Mobile Number</InputLabel>
                        <Input onChange={(e) => onValueChange(e)} name='mobilenumber' id="my-input" />
                    </FormControl>
                    <FormControl>
                        <InputLabel htmlFor="my-input">Email</InputLabel>
                        <Input onChange={(e) => onValueChange(e)} name='email' id="my-input" />
                    </FormControl>
                    <FormControl>
                        <InputLabel htmlFor="my-input">Username</InputLabel>
                        <Input onChange={(e) => onValueChange(e)} name='username' id="my-input" />
                    </FormControl>
                    <FormControl>
                        <InputLabel htmlFor="my-input">Password</InputLabel>
                        <Input onChange={(e) => onValueChange(e)} name='password' id="my-input" />
                    </FormControl>
                    <FormControl>
                        <Button variant="contained" color="secondary" >Login</Button>
                    </FormControl>
                    <FormControl>
                        <p className="p"><NavLink to="/login">Already have an Account</NavLink></p>
                    </FormControl>
                </FormGroup>
            </Container>
        </>
    )
}

export default Signup;
